import React, { Component } from 'react';
import Image from './Image'

class MatchedImages extends Component {

    mapImages = () => {
        console.log(this.props.allImages)
    }

    render() {
        return (
            <div>
                <h1>All Images</h1>
                {this.mapImages()}
                <span>
                     <Image />
                </span>
                <span>
                    <Image />
                </span>
                <span>
                    <Image />
                </span >
                <span>
                    <Image />
                </span >
            </div>
        );
    }
}

export default MatchedImages;
